import React from 'react';
import { useNavigate } from 'react-router-dom';

const DashboardAdminServices = () => {

    const navigate = useNavigate();

    const pageListeServices = () => {
        navigate("/dashboard-admin/liste-services");
    };

    const pageAjoutServices = () => {
        navigate("/dashboard-admin/ajout-services");
    };

    const pageModificationAnimaux = () => {
        navigate("/dashboard-admin/modification-animaux");
    };

    const pageSuppressionAnimaux = () => {
        navigate("/dashboard-admin/suppression-animaux");
    };

    return (
        <div>
            <h3 className="dashboard_text" onClick={pageListeServices}> Voir services </h3>
            <p className="dashboard_text" onClick={pageAjoutServices}>Ajouter</p>
            <p className="dashboard_text">Modifier</p>
            <p className="dashboard_text">Supprimer</p>
        </div>
    );
};

export default DashboardAdminServices;
